import React from "react"

function HomepageImage () {
    return (  
        <div class="col-md-5 col-sm-12 h-25">
            <div class="imgContainer">
                <img class="alexPic" src="./assets/images/Rig2.png" alt="Picture of Alex" />
            </div>
        </div>
      )
}

export default HomepageImage
